import React, {Component} from 'react';
import {Card, Collapse} from "antd";
import img_OA from '../../images/production/OA.jpg';
import cardStyle from './index.module.css';
import {DESCRIBE_OA} from "../../constant";

const {Meta} = Card;
const {Panel} = Collapse;

class Product extends Component {
    render() {
        return (
            <Card className={cardStyle.card} hoverable cover={<img src={img_OA} alt=""/>}>
                <Meta title="OA系统"/>
                <p>{DESCRIBE_OA}</p>
                <Collapse className={cardStyle.coll}>
                    <Panel header="展开详情">
                        <p>默认授权：1000个账号</p>
                        <p>增值授权：1000个账号/¥100,000.00</p>
                    </Panel>
                </Collapse>
            </Card>
        );
    }
}

export default Product;
